import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment';
import { HttpHeaders, HttpClient } from '@angular/common/http';
import { Page } from './models/page';
import { Exam } from './models/exam-settings';
import { QuestionType } from './models/question';

@Injectable()
export class ExamController {
    private baseUrl = environment.baseUrl;
    private surveysUrl = this.baseUrl + '/surveys';

    httpOptions = {
        headers: new HttpHeaders({
            'Authorization': localStorage.getItem('basicauth')
        })
    };

    constructor(private http: HttpClient) {
    }

    getExamById(id: string) {
        return this.http.get(this.surveysUrl + '/' + id);
    }

    createExam(exam: Exam) {
        const request = this.generateExamRequest(exam);
        return this.http.post(this.surveysUrl, request);
    }

    updateExam(exam: Exam) {
        const request = this.generateExamRequest(exam);
        return this.http.put(this.surveysUrl + '/' + exam.id, request);
    }

    publishStudentForEDU(taskId, taskUrl) {
        return this.http.put(`${this.baseUrl}/edu/course/round/detail/id/${taskId}/taskUrl/${taskUrl}`, {});
    }

    submitForEDU(url) {
        return this.http.put(this.baseUrl + url, {}).subscribe(res => {

        }, error => {

        });
    }

    private generateExamRequest(exam: Exam) {
        return {
            name: exam.settings.title.default,
            title: exam.settings.title.default,
            totalGrade: exam.settings.totalScore,
            totalTimer: exam.settings.totalTime,
            surveyBody: {
                title: exam.settings.title,
                pages: this.generateCreateRequest(exam.pages),
            },
            passScore: exam.settings.passScore,
            addRemark: exam.settings.addRemark,
            showAnswer: exam.settings.showAnswer,
            showResult: exam.settings.showResult,
            randomSequnce: exam.settings.randomSequnce,
            totalQuestion: exam.settings.totalQuestion,
            selectedLanguage: exam.settings.selectedLanguage,
            status: exam.status,
            // add dummy data
            "public": true,
            "surveyType": 'EXAM',
            "user": { id: JSON.parse(localStorage.getItem('userData'))['id'] },
            "createdBy": "test",
            "editBy": "qeqw",
            "footer": "xx",
            "introduction": "",
            "logoPosition": "-webkit-left",
            "department": {
                "id": "7"
            },
            "surveytheme": "bootstrap",
            "autoRemindersMonthlyOccurrence": 0,
            "allowMultipleSubmissions": false,
            "description": "",
            "emailInvitationTemplate": "Dear User, Please participate",
            "completedSurveyTemplate": "",
            "sendAutoReminders": false,
            "autoRemindersFrequency": "WEEKLY",
            "autoRemindersWeeklyOccurrence": null,
            "autoRemindersDayOfMonth": 0,
            "logoStyle": {
                "height": 150,
                "width": 150
            },
            "logoStyleWidth": 150,
            "logoStyleHeight": 150,
            "autoRemindersDays": [
            ],
            // tslint:disable-next-line:max-line-length
            "logo": `data:image/jpeg;base64,`
        };
    }

    private generateCreateRequest(pages: Array<Page>) {
        const pagesRequest = [];
        let lastQuestionIndex = 0;
        pages.forEach((page, pageIndex) => {
            const temp = this.getPageQuestions(page, lastQuestionIndex);
            const pageRequest = {
                name: { default: `Page ${pageIndex + 1}` },
                elements: temp.elements
            };
            lastQuestionIndex = temp.lastQuestionIndex;
            pagesRequest.push(pageRequest);
        });
        return pagesRequest;
    }

    private getPageQuestions(page: Page, lastQuestionIndex: number) {
        const elements = [];
        page.elements.forEach(question => {
            const element = {
                image: question.image ? question.image.value : '',
                name: question.name,
                title: question.name,
                type: question.type,
                index: lastQuestionIndex,
                score: question.score,
                weight: question.weight,
                ref: question.refernce,
                choices: undefined,
                correctAnswer: undefined
            };
            if (question.type === QuestionType.checkbox || question.type === QuestionType.radiogroup) {
                element.choices = question.answers.map(answer => answer.value);
                element.correctAnswer = question.answers.filter(answer => answer.correctAnswer).map(answer => answer.value);
                element.correctAnswer = element.correctAnswer.length === 1 ? element.correctAnswer[0] : element.correctAnswer;
            } else if (question.type === QuestionType.boolean) {
                element.choices = question.answers.map(answer => answer.value);
                element.correctAnswer = question.answers.filter(answer => answer.correctAnswer)[0].value.default === 'True' ? true
                    : false;
            }
            lastQuestionIndex++;
            elements.push(element);
        });
        return {
            elements,
            lastQuestionIndex
        };
    }
}
